import React from "react";
import "../Css/Marketplace.css";
import { useNavigate } from "react-router-dom";

function Marketplace() {
  const navigate = useNavigate();

  const goTo = (path) => {
    navigate(path);
  };

  return (
    <div className="marketplace-container">

      {/* INTERNAL NAVBAR */}
      <div className="marketplace-nav">

        <button className="mp-tab" onClick={() => goTo("/marketplace/sell")}>
          <i className="fa fa-store"></i> Sell
        </button>

        <button className="mp-tab" onClick={() => goTo("/marketplace/buy")}>
          <i className="fa fa-handshake"></i> Buy
        </button>

        <button className="mp-tab" onClick={() => goTo("/marketplace/seeds")}>
          <i className="fa fa-seedling"></i> Seeds
        </button>

        <button className="mp-tab" onClick={() => goTo("/marketplace/pesticides")}>
          <i className="fa fa-vial"></i> Pesticides
        </button>

        <button className="mp-tab" onClick={() => goTo("/marketplace/fertilizers")}>
          <i className="fa fa-leaf"></i> Fertilizers
        </button>

      </div>

    </div>
  );
}

export default Marketplace;
